const Navbar = () => {
  return ( 
      <nav className="text-white absolute left-0 right-0 bottom-5 text-xl md:text-3xl m-auto w-full md:w-3/4 z-10 flex flex-wrap justify-center md:justify-evenly">
          <h1 className="py-2 md:py-0 md:px-"><a href="#Home">Home</a></h1>
          <h1 className="py-2 md:py-0"><a href="#About">About</a></h1>
          <h1 className="py-2 md:py-0"><a href="#Projects">Projects</a></h1>
          <h1 className="py-2 md:py-0"><a href="#Contact">Contact</a></h1>
      </nav>
  );
}

export default Navbar;
